import React from "react";
import "../styles/navbarS.css"
import logo from "../assets/logo.png"

const navbarS = function() {
  return (
    <header id = "header__id">
    <a>Ростелеком</a>
        <img src={logo} alt="Logo"/>
    </header>
  )
}

export default navbarS;
